import axios from 'axios';

export function DelAll() {  () => {
    axios.delete('localhost:4000/api')
    .then(res => {
      console.log(res);
      console.log(res.data);
    });
    return (
      <button onClick={this.handleDeleteAll} id="Delhandle">Delete All Data</button>
    )
  }
}
